import React from 'react';
import {Box, Button, Center, Flex, Grid, GridItem, Heading, SimpleGrid, Text} from "@chakra-ui/react";
import {ArrowBackIcon} from "@chakra-ui/icons";

const CreateQuestionPage = () => {
    return (
        <Box bg={'#F7FAFC'} minH={'100vh'}>
            <Flex direction={'column'} justifyContent={'center'} alignItems={'center'}>
                {/*Header*/}
                <Box minH={'60px'} maxH={'80px'} bg={'teal.600'} w={'100%'}>
                    <Flex alignItems={'center'} justifyContent={'space-between'} p={4}>
                        <ArrowBackIcon fontSize={35}/>
                        <Text>Editted 1 minute ago</Text>
                        <Button>Publish</Button>
                    </Flex>
                </Box>
                {/*    Content*/}

                <Flex w='100%' h={'100vh'}>
              <Box flex={'7'}  height={'100vh'} bg={'teal'} align={'center'}>
                  <SimpleGrid  bg={'red'}  alignSelf={'center'} minChildWidth="120px" maxW={'500px'} spacing={5}>
                      <Box bg="tomato">df</Box>
                      <Box bg="tomato">df</Box>
                      <Box bg="tomato">df</Box>
                      <Box bg="tomato">df</Box>
                      <Box bg="tomato">df</Box>
                      <Box bg="tomato">df</Box>
                  </SimpleGrid>
              </Box>
                    <Box flex={'3'} bg={'blue'}>ddd</Box>
                </Flex>


            </Flex>
        </Box>
    );
};

export default CreateQuestionPage;
